    El reflejo condicionado

    Autor: Javier Hernández Chávez

    Introducción

    El reflejo condicionado es un fenómeno psicológico de aprendizaje que fue descubierto por el científico Ruso Ivan Petrovich Pavlov, quien experimentó con perros el aprendizaje estimulado mediante el premio y castigo.

    Teoría

    El aprendizaje ha sido estudiado desde diversos puntos de vista, y se han percatado que el aprendizaje realizado mediante estímulos y a una edad muy temprana produce efectos a largo plazo.

    A este estudio se aunó una serie de observaciones que dieron evidencia de una respuesta ante estímulos externos, como lesiones infringidas y premios obtenidos.

    Esto hace que la mente se incline a hacer las actividades que estimulan la obtención de premios y rechace las que producen castigos.

    Experimentos

    Pavlov experimentó con perros a los que les intervenía quirúrgicamente y obtenía saliva, la cual utilizó como medi");
            WriteLiteral(@"a para ver la excitación al recibir alimentos.

    Cuando les daba su alimento, les tocaba una campana que después de un tiempo asociaban a la obtención de alimento, posteriormente se retiró el alimento pero al sonar la campana el perro tenía la misma reacción que al obtener su alimento.

    Tras varias repeticiones del experimento se llegó a la denominación de reflejo condicionado, pues estimula externamente al perro a tener una reacción ante un estímulo externo, reflejo que a pequeñas edades se puede hacer casi permanente.

    Conclusiones

    Este fenómeno de reflejo condicionado se puede aplicar también a los hombres, como un método factible de aprendizaje siendo la edad temprana la mejor ocasión para enseñar conductas a largo alcance a los niños, lo que se convierte en una costumbre en ocasiones difícil de desarraigar, costumbres como preferencias, lectura, alimentos etc.



